import "../../App.css";

export const HomeScreen = () => {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>Virtual Avalia</p>
        <button onClick={handleAdminLogin}>Login Admin</button>
        <button onClick={handleStudentLogin}>Login Student</button>
      </header>
    </div>
  );
};
